import React from 'react';
import { Container } from '../home/styled'
import { createGlobalStyle } from '../../util/style/global'

function Home() {
  return (
    <createGlobalStyle>
      <Container>
        <h1 id="titulo">OLA CARAIO</h1>;
    </Container>
    </createGlobalStyle>
  )
}

export default Home;
